/* --------------------- JsInterpreterUtils.unlog.js --------------------- */

var JsInterpreterUtils = (function() {

var get_value_ref = function (state, r) {
  var _switch_arg_1 = JsInterpreter.ref_get_value(state,
                        JsCommon.execution_ctx_initial(false),
                        JsSyntax.Coq_resvalue_ref(r));
  switch (_switch_arg_1.tag) {
    case "Coq_result_some":
      var r = _switch_arg_1.value;
      switch (r.tag) {
        case "Coq_specret_val":
          var v = r.value;
          return (Some(v));
        default:
          return (None());
      }
      
    default:
      return (None());
  }
  
};

var get_object_value = function (state, vobj, name) {
  return (
    get_value_ref(state, {
        ref_base: JsSyntax.Coq_ref_base_type_value(vobj),
        ref_name: name,
        ref_strict: false,
        ref_this_value: None()}));
};

var get_global_value = function (state, name) {
  var r = JsCommon.ref_create_env_loc(JsSyntax.env_loc_global_env_record,
            name, true);
  return (get_value_ref(state, r));
};

return {
  get_value_ref: get_value_ref, 
  get_object_value: get_object_value, 
  get_global_value: get_global_value};
})();

